import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="right">
          <form>
            <input className="input" type="number" />
            <textarea cols="30" rows="10"></textarea>
          </form>
        </div>
        <div className="left">left</div>
      </div>
    </div>
  );
}

export default App;
